import React, { Component } from 'react'
import './App.css';
import BookList from './BookList';
console.log(BookList)

export default class App extends Component {
    
    render() {
        return (
            <ul>
          {BookList.map(() => {
              <li key={index}></li>
          })}
            </ul>
        )
    }
}
